import React from "react";
import NavbarItem from "../components/navbarItem"; // Certifique-se de importar o componente NavbarItem corretamente
//import AuthService from "../app/service/authService";
import { AuthConsumer } from "../main/provedorAutenticacao";


const deslogar = () => {
  AuthService.removerUsuarioAutenticado();
}

//onst isUsuarioAutenticado = () => {
 // return AuthService.isUsuarioAutenticado();
//}

function Navbar(props) {
  return (
    <div className="navbar navbar-expand-lg fixed-top navbar-dark bg-primary">
      <div className="container">
        <a href="#/login" className="navbar-brand">Minhas Finanças</a>
        <button className="navbar-toggler" type="button"
          data-toggle="collapse" data-target="#navbarResponsive"
          aria-controls="navbarResponsive" aria-expanded="false"
          aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarResponsive">
          <ul className="navbar-nav">
            <NavbarItem render={props.isUsuarioAutenticado} href="#/home" label="Home" />
            <NavbarItem render={props.isUsuarioAutenticado} href="#/cadastro-usuarios" label="Usuários" />
            <NavbarItem render={props.isUsuarioAutenticado} href="#/consulta-lancamentos" label="Lançamentos" />
            {/*<NavbarItem href="#/login" label="Login" />*/}
            <NavbarItem render={props.isUsuarioAutenticado} onClick={deslogar} href="#/login" label="Sair" />
          </ul>
        </div>
      </div>
    </div>
  );
}

//export default Navbar;

export default () =>(
  <AuthConsumer>
    { (context) => ( 
    <Navbar isUsuarioAutenticado={context.isAutenticado} />
    )}
  </AuthConsumer>
)
